import { IoLibrary, IoSettingsOutline, IoLogOutOutline } from "react-icons/io5";

export const SidebarData = [
  {
    title: "Library",
    path: "/library",
    icon: <IoLibrary />,
    cName: "nav-text",
  },
  {
    title: "Settings",
    path: "/settings",
    icon: <IoSettingsOutline />,
    cName: "nav-text",
  },
  {
    title: "Sign out",
    path: "/login",
    icon: <IoLogOutOutline />,
    cName: "nav-text",
  },
];
